import React from "react";
import UserList from "../Components/UserList";

const Users = () => {
  const Users = [
    {
      id: "u1",
      name: "Sumeet Jumde",
      image:
        "https://park.marmaranyc.com/hubfs/Explore%20Widget/Empire%20State%20Building.jpg",
      places: 2,
    },
  ];
  return (
    <>
      <UserList items={Users} />
    </>
  );
};

export default Users;
